uint calc2fact(lint x) {
    x = x % (1LL << 32);
    int c = 0;
    uint res = 1;
    lint i;
    for (i = 1; i + (1LL << 20) <= x; i += (1LL << 20)) {
        res = steps[c++];
    }
    for (lint j = i; j <= x; j += 2) {
        res *= (uint)j;
    }
    return res;
}

lint floor2(lint x) {
    if (x % 2 == 0) return x - 1;
    else return x;
}

pair<uint, lint> calcfact(lint x) {
    lint p2 = 0;
    uint s2 = 1;
    for (int i = 0; i < 70; i++) {
        p2 += x / 2;
        s2 *= calc2fact(floor2(x));
        x /= 2;
    }
    return mp(s2, p2);
}

